import "./App.css";
import HomeScene from "./Scenes/HomeScene";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  useRouteMatch,
} from "react-router-dom";

function App() {
  const match = useRouteMatch();
  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route path={`${match.path}/:topicId`}>
              <div>topinPage</div>
            </Route>
            <Route path="/">
              <HomeScene />
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
